import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes.js"

function App(){
    return(
        <div>
            <Header/>
            <Note title={notes.title} />
            <Footer/>
            
        </div>
    )
}

export default App;
